import Container from '../../common/Container/Container';
import Typography from '../../common/Typography/Typography';
import Link from '../../common/Link/Link';
import './Logo.scss';

const Logo = () => (
  <Container customClass="logo">
    <Link link="/" customClass="logo__name">
      Coffee
      <Typography varaint="span" customClass="logo__name--secondary">
        Blend
      </Typography>
    </Link>
  </Container>
);

export default Logo;
